@Test public void testBasic() {
  final PrecedenceClimbingParser p = new PrecedenceClimbingParser.Builder()
      .atom("a")
      .infix("+", 1, true)
      .prefix("-", 3)
      .atom("b")
      .infix("*", 2, true)
      .atom("c")
      .postfix("!", 4)
      .build();
  final PrecedenceClimbingParser.Token token = p.parse();
  assertThat(p.print(token), is("(a + ((- b) * (c !)))"));
}

