@Test public void testRepeatedPrefixPostfix() {
  final PrecedenceClimbingParser p = new PrecedenceClimbingParser.Builder()
      .prefix("+", 3)
      .prefix("-", 3)
      .prefix("+", 3)
      .prefix("+", 3)
      .atom("a")
      .postfix("!", 4)
      .infix("+", 1, true)
      .prefix("-", 3)
      .prefix("-", 3)
      .atom("b")
      .postfix("!", 4)
      .postfix("!", 4)
      .build();
  final PrecedenceClimbingParser.Token token = p.parse();
  assertThat(p.print(token),
      is("((+ (- (+ (+ (a !))))) + (- (- ((b !) !))))"));
}

